import React from 'react';

function Project(props) {
  	let projectItems;
  	if(props.projects) {
  		projectItems = props.projects.map(project => {
  			return (	
			    <div className="Project">
			    	<ul>
			    		<li>{project.title}: {project.category}</li>
			    	</ul>	

			    </div>
  			);
 		})	
  	}


}

export default Project;
